const PassValidate = ({ validation }) => {
  return (
    <ul className='list-container'>
      <li className={`lengthValid-${validation.isLengthValid}`}>10文字以上</li>
      {String(validation.isLengthValid)}
      <li className={`uppercase-${validation.hasUppercase}`}>半角大文字</li>
      <li className={`lowercase-${validation.hasLowercase}`}>半角小文字</li>
      <li className={`degit-${validation.hasDegit}`}>半角数値</li>
      <li className={`special-char-${validation.hasSpecialChar}`}>半角記号</li>
    </ul>
  );
};

export default PassValidate;
